    title: "Appointments",
    icon: "av-timer",
  },
  {
    title: "Trips",
    icon: "flight-takeoff",
  },
];

const Index = () => {
  return (
    <View>
      {list.map((item, i) => (
        <ListItem
          key={i}
          title={'Full tilt holy fuck 123'}
          leftIcon={{ name: item.icon }}
          bottomDivider
